"""
Exercise explained here:
https://www.hackerrank.com/challenges/special-palindrome-again/

A string is said to be a special string if either of two conditions is met:

All of the characters are the same, e.g. aaa.
All characters except the middle one are the same, e.g. aadaa.
A special substring is any substring of a string which meets one of those criteria.
Given a string, determine how many special substrings can be formed from it.

For example, given the string s="mnonopoo", we have the following special substrings:
{m, n, o, n, o, p, o, o, non, ono, opo, oo}

"""


input_data = [
    "mnonopoo",  # ["m", "n", "o", "n", "o", "p", "o", "o", "non", "ono", "opo", "oo"]
    "abcbaba",
    "aaaa",
    "",
    "caaaababweweeee"  # [aaaa aba bab aba dddd kkkk wew ewe wew ewe eeee]
]

solutions = [
    12,
    10,
    10,
    # 1272919,
    31
]


def termial_function_sum(n: int) -> int:
    if n == 0:
        return 0
    return int(n * (n + 1) / 2) - n


# Complete the substrCount function below.
def substrCount(n, s):
    stack = []
    counter = len(s)

    """
    aaaa

    stack = [a a a a]
    counter = 4
    consecutinve_chars = 
    """

    for c in s:
        if len(stack) <= 1:
            stack.append(c)
        else:
            if len(stack) == 2:
                if stack[0] == c and stack[1] != c:
                    counter += 1
                    print(f"increasing counter of one for triplet {stack} + {c}")

                if not (stack[0] == c and stack[1] == c):
                    _ = stack.pop(0)
                stack.append(c)
            else:
                if c == stack[-1]:
                    stack.append(c)
                else:
                    consecutinve_chars = len(stack)
                    counter += termial_function_sum(consecutinve_chars)
                    print(f"increasing counter for {stack} with terminal function")
                    stack = [stack[-1], c]

    # flush the array with remaining elems
    # need to check if last threee char as same or triplet
    # print("remaining stuff: {}".format(stack))
    if len(stack) == 3:
        if stack[0] == stack[1] == stack[2]:
            counter += termial_function_sum(len(stack))
            print(f"flushing remaining {len(stack)} with terminal function")
        elif stack[0] == stack[2] != stack[1]:
            counter += 1
            print(f"flushing remaining triplet  with +1 ({len(stack)}) ")
    elif len(stack) > 1:
        base = stack[0]
        number_of_equals = 0
        for elem in range(1, len(stack)):
            if base == stack[elem]:
                number_of_equals += 1
        counter += termial_function_sum(number_of_equals+1)
        print(f"flushing remaining {len(stack)} with terminal function, increasing by {number_of_equals+1}")

    return counter


for input_string, solution in zip(input_data, solutions):
    my_sol = substrCount(len(input_string), input_string)
    print(my_sol)
    # print(solution)
    assert my_sol == solution

print("DONE!")
